import React, { useState } from 'react';
import axios from 'axios';
import './AuthStyles.css';

const Login = ({ onLogin, onSwitchToRegister, onSwitchToForgotPassword }) => {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const [showPassword, setShowPassword] = useState(false);

  const handleLogin = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');

    try {
      const response = await axios.post('http://localhost:8000/api/auth/login', {
        username,
        password
      });

      const { access_token, user, role } = response.data;
      
      // Save token & user info
      localStorage.setItem('token', access_token);
      localStorage.setItem('user', JSON.stringify(user));
      localStorage.setItem('role', role);

      onLogin({ user, role, token: access_token });
    } catch (e) {
      setError(e.response?.data?.detail || 'Login failed');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="auth-page">
      <div className="auth-form-container">
        <div className="auth-card">
          <h1 className="auth-title">üß¨ AIClone</h1>
          <p className="auth-subtitle">Welcome back! Sign in to continue</p>

          <form onSubmit={handleLogin}>
            {error && <div className="error-box">‚ùå {error}</div>}

            <div className="form-group">
              <label className="auth-label">üë§ Username</label>
              <div className="auth-input-wrapper">
                <input
                  type="text"
                  value={username}
                  onChange={(e) => setUsername(e.target.value)}
                  placeholder="Enter your username"
                  className="auth-input"
                  disabled={loading}
                />
              </div>
            </div>

            <div className="form-group">
              <label className="auth-label">üîê Password</label>
              <div className="auth-input-wrapper">
                <input
                  type={showPassword ? 'text' : 'password'}
                  value={password}
                  onChange={(e) => setPassword(e.target.value)}
                  placeholder="Enter your password"
                  className="auth-input"
                  disabled={loading}
                />
                <button
                  type="button"
                  className="password-toggle"
                  onClick={() => setShowPassword(!showPassword)}
                  disabled={loading}
                >
                  {showPassword ? 'üëÅÔ∏è' : 'üëÅÔ∏è‚Äçüó®Ô∏è'}
                </button>
              </div>
            </div>

            <button
              type="button"
              onClick={onSwitchToForgotPassword}
              className="auth-button-secondary"
              style={{ marginBottom: '20px', textAlign: 'center' }}
              disabled={loading}
            >
              üîë Forgot Password?
            </button>

            <button
              type="submit"
              className={`auth-button ${loading ? 'loading' : ''}`}
              disabled={loading}
            >
              {loading ? '‚è≥ Signing in...' : 'üöÄ Sign In'}
            </button>
          </form>

          <div className="auth-divider">Or</div>

          <button
            onClick={onSwitchToRegister}
            className="auth-button-secondary"
            disabled={loading}
          >
            ‚ú® Create New Account
          </button>

          <div className="auth-footer">
            <p>üß¨ <strong>AIClone Chat System</strong> by Nguy·ªÖn Ph∆∞∆°c ƒê·∫°i</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Login;
